import React from "react";
import s from './SearchData.module.css'

const SearchData = (props) => {
    let select = []
    for (const selectKey in props.selectData) {
        select.push(<option>{selectKey}</option>)
    }
    return (
        <div>
            <select>
                {select}
            </select>
            <input className={s.searchInput} type={"text"} placeholder={"Pls write something"}/>
            <button className={s.findButton}>Find</button>
        </div>
    )
}


export default SearchData
